import React, { InputHTMLAttributes, useCallback } from 'react';
import { nome, whats } from './masks'
import './Form.css'

interface InputProps extends InputHTMLAttributes<HTMLInputElement> {
    mask: "nome" | "whats";
}

const Form: React.FC<InputProps> = ({ mask, ...props }) => {
    const handleKeyUp = useCallback((e: React.FormEvent<HTMLInputElement>) => {
        if (mask === 'nome') {
            nome(e);
        }
        if (mask === 'whats') {
            whats(e);
        }
    }, [mask]);
    return (
        <div className="form">
            <div className="formWrapper">
                <label className="nome" >Nome</label>
                <input {...props} onKeyUp={handleKeyUp} type="text" />
                <label className="email">Email</label>
                <input {...props} type="email" />
                <label className="whats">WhatsApp</label>
                <input {...props} type="text" name="Whats" id="whats_id" />
            </div>
            <div className="aut">
                <input {...props} className="checkbox" type="checkbox" name="Autorizacao" id="autorizacao_id" />
                <label className="autorizacao" >Eu atorizo um consutor da Smile entrar em contato comigo via WhatsApp.</label>
            </div>
            <button >ENVIAR</button>
        </div>
    )
}

export default Form;
